import React, { Component } from 'react';
import '../component-styles/project.css'
import Slider from "react-slick";
class ProjectsCard extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      slidesToShow: 3,
      slidesToScroll:3,
      autoplay: true,
      speed: 5000,
      autoplaySpeed: 5000,
      cssEase: "linear"
    };
    return (
      <div id='project-main-card-container'> 
      <Slider {...settings}>
      <div className='project-card-container'><div className="inner-card-container">1</div></div> 
      <div className='project-card-container'><div className="inner-card-container">2</div></div> 
      <div className='project-card-container'><div className="inner-card-container">3</div></div> 
      <div className='project-card-container'><div className="inner-card-container">4</div></div> 
      <div className='project-card-container'><div className="inner-card-container">5</div></div> 
      <div className='project-card-container'><div className="inner-card-container">6</div></div> 
      <div className='project-card-container'><div className="inner-card-container">7</div></div> 
      <div className='project-card-container'><div className="inner-card-container">8</div></div> 
      <div className='project-card-container'><div className="inner-card-container">9</div></div> 

      </Slider>
    </div>
    );
  }
}

export default  ProjectsCard ;
